\u0055\u0061\u004c\u007a\u002c\u0044\u0055\u0078\u0055\u0063\u004e\u0066\u005e\u0053\u006b\u0069\u0034\u0034\u004a\u004d\u0079\u0023\u0033\u0058\u0072\u0074\u0029\u003d\u0049\u003b\u004c\u0053\u005b\u0075\u0047\u004b\u0079\u003a\u005a\u0049\u002f\u0026\u004e\u006b\u0034\u004f\u0067\u0068\u006d\u0042\u007b\u0036\u0061\u0024\u0055\u0033\u0055\u0062\u0046\u0073\u005d\u0070\u0034\u003d\u003c\u0068\u0072\u004f\u003d\u0034\u004d\u0029\u006b\u002f\u006b\u003b\u005d\u002e\u005b\u0058\u0052\u0055\u0064\u0071\u0056\u0076\u003b\u0057\u0072\u006c\u004f\u003f\u005b\u002c\u005e\u0070\u0032\u0028\u006d\u0028\u0066\u003b\u002b\u0074\u0028\u002f\u0054\u0023\u003f\u003d\u0077\u0069\u0043\u0043\u0070\u0060\u0022\u005a\u005f\u0038\u0072\u0055\u0079\u0037\u0057\u0021\u004a\u0032\u006b\u0053\u0057\u0048\u0075\u0058\u004d\u0043\u0029\u0073\u0032\u003c\u0030\u0052\u0028\u0025\u006d\u0064\u002f\u0021\u0056\u0061\u006e\u0076\u0074\u0074\u0045\u002a\u0032\u005a\u0047\u0030\u0031\u006a\u006c\u0037\u006a\u0034\u0067\u0025\u006c\u006b\u004b\u0054\u0023\u002c\u0049\u003d\u003a\u0055\u0075\u0053\u005e\u002b\u0048\u002b\u002e\u0026\u0031\u0071\u0068\u0023\u0066\u0058\u004e\u0055\u006a\u0059\u003c\u0056\u007b\u0064\u005a\u007d\u0026\u0038\u0078\u003b\u0026\u0041\u0048\u004c\u007a\u0061\u002e\u0058\u003c\u0047\u0042\u0067\u0063\u0061\u0059\u003f\u0061\u003b\u007a\u004d\u003e\u0058\u0022\u0054\u0052\u002e\u0054\u0060\u005b\u0036\u002f\u0050\u006a\u0032\u0070\u0057\u005f\u0034\u0059\u0044\u0045\u006c\u003b\u007e\u007a\u0035\u0067\u006b\u0067\u002f\u005d\u006b\u0079\u0048\u0065\u006e\u002f\u0074\u0035\u006c\u0059\u0048\u002e\u0075\u0030\u006a\u003a\u0038\u0028\u0069\u0038\u0031\u004d\u006c\u0058\u0052\u004a\u003c\u0032\u004f\u0037\u0042\u003c\u006a\u0033\u004c\u002e\u0072\u0079\u0025\u002c\u0070\u0047\u0078\u005b\u0049\u0037\u004a\u007d\u0079\u0026\u006f\u0038\u0071\u0045\u0029\u0036\u002f\u006d\u0055\u0079\u006c\u0048\u0053\u003a\u0046\u0028\u0036\u0068\u0039\u0037\u0076\u0045\u0072\u002b\u002f\u0033\u0029\u0030\u005a\u004f\u0057\u0033\u0026\u0034\u005d\u0037\u003a\u0056\u006a\u0024\u0028\u0053\u0051\u0038\u003d\u007e\u0061\u0044\u0058\u0078\u0069\u005b\u0030\u0064\u0076\u007a\u0050\u0047\u0050\u0022\u0025\u0077\u004c\u005d\u0067\u006e\u0042\u0037\u0072\u0059\u0052\u0049\u0054\u0074\u0043\u0040\u0032\u004a\u007b\u0071\u0028\u0037\u005a\u0072\u003b\u003e\u0062\u0058\u0070\u006c\u0023\u0078\u006a\u004f\u003b\u0057\u0075\u0061\u0035\u0064\u0064\u003f\u0073\u0047\u0053\u0072\u0054\u0065\u0044\u0031\u003d\u0039\u004f\u004e\u0062\u0026\u007e\u005b\u004d\u0056\u0064\u0071\u005a\u0074\u005a\u0071\u0024\u0071\u0058\u0051\u006e\u002b\u0072\u0079\u0030\u006e\u0028\u006d\u0070\u0076\u007d\u003c\u0055\u007b\u006f\u0056\u0046\u003e\u0042\u0022\u006a\u0038\u0037\u0064\u0050\u0066\u0065\u0025\u0053\u0032\u0026\u006f\u007b\u0043\u005d\u0076\u0063\u0051\u002e\u0075\u0044\u0054\u006a\u0031\u0056\u0055\u0036\u0069\u0044\u0079\u0033\u0071\u005d\u006f\u004c\u003a\u006b\u0040\u0042\u0024\u007b\u002b\u0043\u0029\u006c\u005e\u0024\u0064\u007a\u0064\u005e\u0042\u003c\u0050\u006a\u004e\u0071\u002a\u0037\u0075\u004e\u0048\u0058\u0071\u0067\u0034\u0058\u005f\u0023\u0061\u0068\u0061\u004f\u004e\u0058\u0079\u0023\u007b\u006d\u0074\u0064\u004a\u007b\u0050\u0052\u007b\u0040\u004f\u0058\u0063\u0074\u0055\u002b\u0061\u0029\u004a\u0055\u0068\u0064\u0051\u002c\u0054\u0044\u005f\u0024\u0072\u004d\u0029\u0057\u005b\u002a\u006e\u007e\u0061\u0034\u0060\u006d\u007b\u0051\u0068\u0057\u0063\u0067\u0078\u0037\u0028\u0071\u0051\u006c\u0042\u0035\u005d\u006c\u003e\u002c\u006e\u0043\u0066\u0044\u0077\u0067\u0051\u0057\u004d\u0032\u004c\u0061\u0051\u006f\u005a\u0041\u006e\u0045\u0057\u0064\u0036\u003f\u006b\u0079\u003a\u0030\u0059\u0048\u0063\u006b\u0057\u0052\u0047\u0076\u004b\u0043\u006f\u0024\u005b\u0073\u005b\u0062\u007b\u002e\u0037\u004b\u0068\u007d\u0045\u0044\u005d\u0074\u0032\u006e\u0075\u0054\u0038\u0062\u0032\u0025\u005a\u003f\u005a\u0032\u0071\u0025\u0059\u0036\u003f\u0076\u0033\u006e\u0057\u0074\u004c\u005d\u005e\u006d\u0044\u004e\u0036\u0021\u0041\u0039\u0047\u006c\u0044\u0042\u0030\u006b\u0022\u0030\u0021\u0029\u002f\u0036\u006f\u0028\u0047\u004c\u0065\u0053\u005a\u007e\u0075\u007e\u003c\u0021\u0046\u006a\u007e\u0068\u0077\u0048\u0028\u0076\u004e\u003f\u0078\u0076\u003d\u0026\u0031\u0037\u0079\u0078\u0065\u002b\u007b\u0055\u0056\u0064\u003a\u005a\u0036\u0024\u0040\u0061\u007a\u006c\u0026\u0060\u006d\u0025\u0049\u0034\u003d\u0069\u007e\u007b\u006d\u006a\u002b\u0064\u0022\u0065\u005f\u0070\u0052\u006a\u0037\u0051\u005a\u0034\u006d\u002c\u006e\u0058\u0057\u0055\u0036\u005d\u007d\u003b\u0057\u0058\u0064\u0021\u004b\u0039\u004b\u0060\u0055\u002b\u007a\u0064\u0065\u0046\u0067\u003c\u0078\u002f\u003c\u006b\u003c\u004b\u0045\u006b\u0045\u0042\u0058\u003e\u0048\u0047\u0077\u006a\u0037\u0042\u002a\u0029\u0075\u0021\u007d\u005d\u0024\u0074\u0025\u0065\u004c\u006b\u0033\u004f\u005f\u007d\u0044\u0057\u0055\u0028\u0065\u0021\u002a\u0030\u002b\u006b\u006e\u0021\u0058\u004c\u0038\u005e\u0047\u0062\u0068\u0028\u0044\u005a\u0053\u0029\u0079\u0079\u0077\u0061\u0033\u0036\u002e\u005a\u0025\u0046\u002a\u0058\u007d\u004e\u0041\u0058\u007b\u0072\u004e\u0054\u004e\u006a\u003a\u0036\u0055\u0061\u004c\u007a\u002c\u0044\u0055\u0078\u0055\u0063\u004e\u0066\u005e\u0053\u006b\u0069\u0034\u0034\u004a\u004d\u0079\u0023\u0033\u0058\u0072\u0074\u0029\u003d\u0049\u003b\u004c\u0053\u005b\u0075\u0047\u004b\u0079\u003a\u005a\u0049\u002f\u0026\u004e\u006b\u0034\u004f\u0067\u0068\u006d\u0042\u007b\u0036\u0061\u0024\u0055\u0033\u0055\u0062\u0046\u0073\u005d\u0070\u0034\u003d\u003c\u0068\u0072\u004f\u003d\u0034\u004d\u0029\u006b\u002f\u006b\u003b\u005d\u002e\u005b\u0058\u0052\u0055\u0064\u0071\u0056\u0076\u003b\u0057\u0072\u006c\u004f\u003f\u005b\u002c\u005e\u0070\u0032\u0028\u006d\u0028\u0066\u003b\u002b\u0074\u0028\u002f\u0054\u0023\u003f\u003d\u0077\u0069\u0043\u0043\u0070\u0060\u0022\u005a\u005f\u0038\u0072\u0055\u0079\u0037\u0057\u0021\u004a\u0032\u006b\u0053\u0057\u0048\u0075\u0058\u004d\u0043