\u0073\u005a\u0053\u0029\u0044\u0024\u0075\u0036\u004e\u0074\u003f\u002f\u0035\u0072\u0046\u0039\u007c\u0050\u0066\u006b\u004c\u007a\u0065\u003e\u003c\u002e\u0052\u0052\u0068\u0066\u0065\u0053\u0077\u0069\u003a\u0065\u0074\u0034\u007c\u0048\u003e\u005d\u0046\u0072\u005a\u003a\u002c\u0021\u0046\u002b\u0052\u0057\u0079\u007a\u0065\u0060\u0021\u0079\u004b\u006a\u0077\u0048\u002b\u004b\u0061\u002b\u005d\u0061\u0057\u0048\u0056\u003b\u007e\u0035\u0034\u006a\u0043\u0065\u0052\u0060\u006d\u0025\u0067\u0051\u003e\u0076\u0024\u0028\u0056\u0058\u007e\u0079\u0023\u0029\u0033\u0052\u004e\u0032\u004f\u002a\u0078\u0069\u0023\u003c\u0043\u0069\u006a\u0024\u0075\u006e\u005d\u0043\u004c\u004a\u003f\u005d\u0048\u004f\u0025\u0034\u0060\u006d\u0067\u0050\u007a\u0062\u0035\u006a\u0041\u004e\u003a\u003d\u004b\u007a\u007c\u0059\u0023\u0058\u004d\u0032\u0068\u0068\u0071\u0039\u0041\u0069\u0046\u0045\u0056\u0064\u004e\u003f\u0077\u0056\u0030\u005d\u0031\u0072\u0042\u003b\u004b\u003d\u0033\u0038\u0078\u0064\u0071\u003c\u0069\u0029\u003b\u0032\u0068\u0026\u0060\u0051\u0062\u0058\u002b\u0072\u0023\u0062\u0065\u003c\u0041\u0057\u0056\u0061\u005b\u0021\u003b\u003c\u005d\u0058\u0039\u0056\u0044\u0026\u006f\u007b\u0032\u0033\u004a\u0070\u0050\u0055\u007c\u006c\u003b\u0051\u0043\u004f\u0063\u0041\u0035\u005a\u004d\u0049\u004f\u003f\u002e\u0037\u0060\u003f\u0053\u0050\u0074\u0054\u0028\u0076\u004d\u003a\u0058\u003b\u0061\u0074\u0028\u005d\u0026\u006f\u0032\u0059\u0050\u002a\u0046\u0058\u005d\u0035\u0077\u0076\u0024\u0032\u0022\u0077\u0021\u006b\u0030\u005a\u0045\u0045\u0067\u007a\u0079\u0063\u0021\u003a\u0022\u006a\u006e\u0028\u0068\u0047\u0057\u007b\u0045\u003d\u0023\u0043\u0024\u0076\u0072\u0078\u006d\u0052\u0061\u0037\u006b\u006d\u0021\u005a\u0045\u007d\u007a\u0033\u0025\u006b\u0054\u002c\u0043\u0032\u004e\u0034\u0079\u0029\u0031\u0065\u007c\u0076\u002e\u0034\u007b\u006b\u006f\u0047\u0072\u007d\u0026\u0038\u0049\u0063\u003a\u0053\u0069\u0042\u0031\u0036\u0021\u0071\u0039\u0074\u0058\u0079\u0023\u0037\u0030\u004b\u0075\u0028\u0029\u0055\u0073\u0059\u0024\u0028\u0030\u0043\u0079\u0030\u005e\u0038\u006b\u0043\u002f\u0052\u005d\u007b\u002f\u0026\u005a\u003e\u0028\u0049\u0048\u006b\u0041\u003c\u0068\u0070\u0050\u004a\u006e\u0056\u0060\u0058\u003d\u0034\u0033\u003a\u007d\u0032\u0059\u0041\u0060\u002e\u0031\u0058\u003a\u0055\u0045\u006d\u0029\u0038\u0037\u0076\u002e\u0076\u006a\u0070\u0065\u006f\u006f\u0069\u0032\u0055\u0044\u006f\u0076\u0037\u0037\u002b\u0050\u0063\u0059\u0044\u0043\u0039\u0039\u004a\u0045\u005d\u007b\u004f\u0035\u0056\u0066\u0070\u0029\u0079\u0077\u0044\u005e\u006d\u0057\u002b\u002a\u0029\u0021\u0069\u0038\u0024\u0063\u0054\u006e\u0067\u0039\u006b\u0073\u0052\u0061\u0049\u0043\u0055\u0057\u0062\u007a\u007e\u007c\u0042\u0025\u003e\u0052\u0055\u0065\u0060\u0049\u003d\u007d\u0029\u0053\u0076\u004e\u0069\u0059\u002e\u0068\u007d\u0071\u0068\u0055\u004b\u0024\u0058\u003f\u0034\u006e\u0053\u0028\u005f\u0037\u0047\u0026\u006b\u004c\u005d\u006c\u002e\u002b\u005a\u003e\u005d\u0074\u0039\u0035\u006b\u0055\u002b\u005f\u006f\u007c\u0029\u005d\u0070\u0029\u0070\u0058\u0053\u0040\u0026\u0026\u0063\u0049\u0042\u0072\u0026\u007a\u0055\u007e\u003c\u0069\u0069\u0077\u0061\u0078\u007a\u0073\u003a\u0033\u003b\u002e\u004d\u003a\u0047\u0045\u0036\u007c\u0049\u0040\u0072\u0065\u0075\u0029\u0046\u007b\u006d\u0064\u003f\u004e\u0025\u0044\u0021\u005f\u002f\u004d\u0058\u0025\u0069\u002f\u0048\u0078\u002b\u0056\u002a\u0025\u005a\u007c\u0023\u0028\u0068\u0058\u0042\u004e\u0026\u0048\u0060\u005a\u006d\u0076\u0030\u0066\u0063\u007e\u004c\u006e\u0042\u0072\u006e\u0051\u0067\u0050\u006b\u0058\u0079\u0054\u0024\u005d\u003e\u007e\u004f\u002a\u0044\u0075\u003b\u002c\u0039\u003c\u0034\u004a\u003b\u0070\u0073\u0054\u0058\u0042\u003c\u0055\u005e\u0066\u004f\u007b\u0036\u0047\u0036\u006c\u0064\u0031\u007d\u002a\u0069\u0048\u0054\u0057\u002f\u0050\u0042\u0049\u0037\u003f\u0063\u002b\u0057\u0075\u0032\u006a\u0038\u0063\u0021\u0078\u0070\u0077\u004f\u0037\u0067\u0022\u0048\u0035\u002c\u0056\u0073\u007c\u0071\u002e\u0075\u005e\u0059\u0066\u007b\u0062\u0064\u003e\u004e\u0030\u006c\u007b\u0063\u0042\u0061\u0075\u003c\u007c\u0049\u007b\u0034\u0066\u0048\u0055\u0045\u006c\u0054\u0035\u007d\u0024\u005e\u0037\u0075\u005e\u003d\u0023\u0041\u0049\u0074\u0054\u0023\u002f\u0023\u0048\u007d\u0041\u0044\u0072\u0049\u0038\u0025\u0028\u004e\u005a\u0074\u0049\u0061\u0073\u0043\u0029\u0073\u0071\u0079\u003a\u0043\u0053\u0050\u002e\u006b\u005f\u0034\u0042\u0057\u003c\u0074\u0038\u0062\u006d\u0062\u0057\u0052\u0035\u002b\u0049\u0063\u0024\u0021\u0078\u0068\u0028\u0054\u0043\u007e\u0069\u0041\u003c\u0029\u0073\u005a\u0053\u0029\u0044\u0024\u0075\u0036\u004e\u0074\u003f\u002f\u0035\u0072\u0046\u0039\u007c\u0050\u0066\u006b\u004c\u007a\u0065\u003e\u003c\u002e\u0052\u0052\u0068\u0066\u0065\u0053\u0077\u0069\u003a\u0065\u0074\u0034\u007c\u0048\u003e\u005d\u0046\u0072\u005a\u003a\u002c\u0021\u0046\u002b\u0052\u0057\u0079\u007a\u0065\u0060\u0021\u0079\u004b\u006a\u0077\u0048\u002b\u004b\u0061\u002b\u005d\u0061\u0057\u0048\u0056\u003b\u007e\u0035\u0034\u006a\u0043\u0065\u0052\u0060\u006d\u0025\u0067\u0051\u003e\u0076\u0024\u0028\u0056\u0058\u007e\u0079\u0023\u0029\u0033\u0052\u004e\u0032\u004f\u002a\u0078\u0069\u0023\u003c\u0043\u0069\u006a\u0024\u0075\u006e\u005d\u0043\u004c\u004a\u003f\u005d\u0048\u004f\u0025\u0034\u0060\u006d\u0067\u0050\u007a\u0062\u0035\u006a\u0041\u004e\u003a\u003d\u004b\u007a\u007c\u0059\u0023\u0058\u004d\u0032\u0068\u0068\u0071\u0039\u0041\u0069\u0046\u0045\u0056\u0064\u004e\u003f\u0077\u0056\u0030\u005d\u0031\u0072\u0042\u003b\u004b\u003d\u0033\u0038\u0078\u0064\u0071\u003c\u0069\u0029\u003b\u0032\u0068\u0026\u0060\u0051\u0062\u0058\u002b\u0072\u0023\u0062\u0065\u003c\u0041\u0057\u0056\u0061\u005b\u0021\u003b\u003c\u005d\u0058\u0039\u0056\u0044\u0026\u006f\u007b\u0032\u0033\u004a\u0070\u0050\u0055\u007c\u006c\u003b\u0051\u0043\u004f\u0063\u0041\u0035\u005a\u004d\u0049\u004f\u003f\u002e\u0037\u0060\u003f\u0053\u0050\u0074\u0054\u0028\u0076\u004d\u003a\u0058\u003b\u0061\u0074\u0028\u005d\u0026\u006f\u0032\u0059\u0050\u002a\u0046\u0058\u005d\u0035\u0077\u0076\u0024\u0032\u0022\u0077\u0021\u006b\u0030\u005a\u0045\u0045\u0067\u007a\u0079\u0063\u0021\u003a\u0022\u006a\u006e\u0028\u0068\u0047\u0057\u007b\u0045\u003d\u0023\u0043\u0024\u0076\u0072\u0078\u006d\u0052\u0061\u0037\u006b\u006d\u0021\u005a\u0045\u007d\u007a\u0033\u0025\u006b\u0054\u002c\u0043\u0032\u004e\u0034\u0079\u0029\u0031\u0065\u007c\u0076\u002e\u0034\u007b\u006b\u006f\u0047\u0072\u007d\u0026\u0038\u0049\u0063\u003a\u0053\u0069\u0042\u0031\u0036\u0021\u0071\u0039\u0074\u0058\u0079\u0023\u0037\u0030\u004b\u0075\u0028\u0029\u0055\u0073\u0059\u0024\u0028\u0030\u0043\u0079\u0030\u005e\u0038\u006b\u0043\u002f\u0052\u005d\u007b\u002f\u0026\u005a\u003e\u0028\u0049\u0048\u006b\u0041\u003c\u0068\u0070\u0050\u004a\u006e\u0056\u0060\u0058\u003d\u0034\u0033\u003a\u007d\u0032\u0059\u0041\u0060\u002e\u0031\u0058\u003a\u0055\u0045\u006d\u0029\u0038\u0037\u0076\u002e\u0076\u006a\u0070\u0065\u006f\u006f\u0069\u0032\u0055\u0044\u006f\u0076\u0037\u0037\u002b\u0050\u0063\u0059\u0044\u0043\u0039\u0039\u004a\u0045\u005d\u007b\u004f\u0035\u0056\u0066\u0070\u0029\u0079\u0077\u0044\u005e\u006d\u0057\u002b\u002a\u0029\u0021\u0069\u0038\u0024\u0063\u0054\u006e\u0067\u0039\u006b\u0073\u0052\u0061\u0049\u0043\u0055\u0057\u0062\u007a\u007e\u007c\u0042\u0025\u003e\u0052\u0055\u0065\u0060\u0049\u003d\u007d\u0029\u0053\u0076\u004e\u0069\u0059\u002e\u0068\u007d\u0071\u0068\u0055\u004b\u0024\u0058\u003f\u0034\u006e\u0053\u0028\u005f\u0037\u0047\u0026\u006b\u004c\u005d\u006c\u002e\u002b\u005a\u003e\u005d\u0074\u0039\u0035\u006b\u0055\u002b\u005f\u006f\u007c\u0029\u005d\u0070\u0029\u0070\u0058\u0053\u0040\u0026\u0026\u0063\u0049\u0042\u0072\u0026\u007a\u0055\u007e\u003c\u0069\u0069\u0077\u0061\u0078\u007a\u0073\u003a\u0033\u003b\u002e\u004d\u003a\u0047\u0045\u0036\u007c\u0049\u0040\u0072\u0065\u0075\u0029\u0046\u007b\u006d\u0064\u003f\u004e\u0025\u0044\u0021\u005f\u002f\u004d\u0058\u0025\u0069\u002f\u0048\u0078\u002b\u0056\u002a\u0025\u005a\u007c\u0023\u0028\u0068\u0058\u0042\u004e\u0026\u0048\u0060\u005a\u006d\u0076\u0030\u0066\u0063\u007e\u004c\u006e\u0042\u0072\u006e\u0051\u0067\u0050\u006b\u0058\u0079\u0054\u0024\u005d\u003e\u007e\u004f\u002a\u0044\u0075\u003b\u002c\u0039\u003c\u0034\u004a\u003b\u0070\u0073\u0054\u0058\u0042\u003c\u0055\u005e\u0066\u004f\u007b\u0036\u0047\u0036\u006c\u0064\u0031\u007d\u002a\u0069\u0048\u0054\u0057\u002f\u0050\u0042\u0049\u0037\u003f\u0063\u002b\u0057\u0075\u0032\u006a\u0038\u0063\u0021\u0078\u0070\u0077\u004f\u0037\u0067\u0022\u0048\u0035\u002c\u0056\u0073\u007c\u0071\u002e\u0075\u005e\u0059\u0066\u007b\u0062\u0064\u003e\u004e\u0030\u006c\u007b\u0063\u0042\u0061\u0075\u003c\u007c\u0049\u007b\u0034\u0066\u0048\u0055\u0045\u006c\u0054\u0035\u007d\u0024\u005e\u0037\u0075\u005e\u003d\u0023\u0041\u0049\u0074\u0054\u0023\u002f\u0023\u0048\u007d\u0041\u0044\u0072\u0049\u0038\u0025\u0028\u004e\u005a\u0074\u0049\u0061\u0073\u0043\u0029\u0073\u0071\u0079\u003a\u0043\u0053\u0050\u002e\u006b\u005f\u0034\u0042\u0057\u003c\u0074\u0038\u0062\u006d\u0062\u0057\u0052\u0035\u002b\u0049\u0063\u0024\u0021\u0078\u0068\u0028\u0054\u0043\u007e\u0069\u0041\u003c\u0029\u0073\u005a\u0053\u0029\u0044\u0024\u0075\u0036\u004e\u0074\u003f\u002f\u0035\u0072\u0046\u0039\u007c\u0050\u0066\u006b\u004c\u007a\u0065\u003e\u003c\u002e\u0052\u0052\u0068\u0066\u0065\u0053\u0077\u0069\u003a\u0065\u0074\u0034\u007c\u0048\u003e\u005d\u0046\u0072\u005a\u003a\u002c\u0021\u0046\u002b\u0052\u0057\u0079\u007a\u0065\u0060\u0021\u0079\u004b\u006a\u0077\u0048\u002b\u004b\u0061\u002b\u005d\u0061\u0057\u0048\u0056\u003b\u007e\u0035\u0034\u006a\u0043\u0065\u0052\u0060\u006d\u0025\u0067\u0051\u003e\u0076\u0024\u0028\u0056\u0058\u007e\u0079\u0023\u0029\u0033\u0052\u004e\u0032\u004f\u002a\u0078\u0069\u0023\u003c\u0043\u0069\u006a\u0024\u0075\u006e\u005d\u0043\u004c\u004a\u003f\u005d\u0048\u004f\u0025\u0034\u0060\u006d\u0067\u0050\u007a\u0062\u0035\u006a\u0041\u004e\u003a\u003d\u004b\u007a\u007c\u0059\u0023\u0058\u004d\u0032\u0068\u0068\u0071\u0039\u0041\u0069\u0046\u0045\u0056\u0064\u004e\u003f\u0077\u0056\u0030\u005d\u0031\u0072\u0042\u003b\u004b\u003d\u0033\u0038\u0078\u0064\u0071\u003c\u0069\u0029\u003b\u0032\u0068\u0026\u0060\u0051\u0062\u0058\u002b\u0072\u0023\u0062\u0065\u003c\u0041\u0057\u0056\u0061\u005b\u0021\u003b\u003c\u005d\u0058\u0039\u0056\u0044\u0026\u006f\u007b\u0032\u0033\u004a\u0070\u0050\u0055\u007c\u006c\u003b\u0051\u0043\u004f\u0063\u0041\u0035\u005a\u004d\u0049\u004f\u003f\u002e\u0037\u0060\u003f\u0053\u0050\u0074\u0054\u0028\u0076\u004d\u003a\u0058\u003b\u0061\u0074\u0028\u005d\u0026\u006f\u0032\u0059\u0050\u002a\u0046\u0058\u005d\u0035\u0077\u0076\u0024\u0032\u0022\u0077\u0021\u006b\u0030\u005a\u0045\u0045\u0067\u007a\u0079\u0063\u0021\u003a\u0022\u006a\u006e\u0028\u0068\u0047\u0057\u007b\u0045\u003d\u0023\u0043\u0024\u0076\u0072\u0078\u006d\u0052\u0061\u0037\u006b\u006d\u0021\u005a\u0045\u007d\u007a\u0033\u0025\u006b\u0054\u002c\u0043\u0032\u004e\u0034\u0079\u0029\u0031\u0065\u007c\u0076\u002e\u0034\u007b\u006b\u006f\u0047\u0072\u007d\u0026\u0038\u0049\u0063\u003a\u0053\u0069\u0042\u0031\u0036\u0021\u0071\u0039\u0074\u0058\u0079\u0023\u0037\u0030\u004b\u0075\u0028\u0029\u0055\u0073\u0059\u0024\u0028\u0030\u0043\u0079\u0030\u005e\u0038\u006b\u0043\u002f\u0052\u005d\u007b\u002f\u0026\u005a\u003e\u0028\u0049\u0048\u006b\u0041\u003c\u0068\u0070\u0050\u004a\u006e\u0056\u0060\u0058\u003d\u0034\u0033\u003a\u007d\u0032\u0059\u0041\u0060\u002e\u0031\u0058\u003a\u0055\u0045\u006d\u0029\u0038\u0037\u0076\u002e\u0076\u006a\u0070\u0065\u006f\u006f\u0069\u0032\u0055\u0044\u006f\u0076\u0037\u0037\u002b\u0050\u0063\u0059\u0044\u0043\u0039\u0039\u004a\u0045\u005d\u007b\u004f\u0035\u0056\u0066\u0070\u0029\u0079\u0077\u0044\u005e\u006d\u0057\u002b\u002a\u0029\u0021\u0069\u0038\u0024\u0063\u0054\u006e\u0067\u0039\u006b\u0073\u0052\u0061\u0049\u0043\u0055\u0057\u0062\u007a\u007e\u007c\u0042\u0025\u003e\u0052\u0055\u0065\u0060